import './App.css';
import { useState } from "react"

function App() {

  const [idTrabajador, setIdTrabajador] = useState("");
  const [nombreContacto, setNombreContacto] = useState("");
  const [direccionContacto, setDireccionContacto] = useState("");
  const [localidadContacto, setLocalidadContacto] = useState("");
  const [provinciaContacto, setProvinciaContacto] = useState("");
  const [telefonoContacto, setTelefonoContacto] = useState("");
  const [observacionesContacto, setObservacionesContacto] = useState("");


  return (
    <div className="App">
      <h1>Formulario de contacto</h1>
      <div className="datos">
        <label>ID trabajador: <input type="text"></input></label> 
        <label>Nombre completo del contacto: <input type="text"></input></label>
        <label>Dirección del contacto: <input type="text"></input></label>
        <label>Localidad del contacto: <input type="text"></input></label>
        <label>Provincia del contacto: <input type="text"></input></label>
        <label>Teléfono de contacto: <input type="text"></input></label>
        <label>Observaciones del contacto: <input type="text"></input></label>
        <button>Registrar</button>
      </div>
    </div>
  );
}

export default App;
